@lukeinproperty @Dani_Passmore @LissaLynch @PickardJE The evidence I have is the words that fell from his prolapsed sphincter of a mouth in the first presidential debate September 2016. 

He said he would release them after an audit. He was not talking about a partial 2005 return.

Also, not your evidence-wallah. Do your own work.

@lukeinproperty @Dani_Passmore @LissaLynch @PickardJE Yes, I did the simple stuff, like tax returns. 

It’s “the bottom rung”, as “bottom of the rung” makes no sense. 

Amazing what you pick up by learning, and not just assuming you know it all, and that everyone else must be thick.

@PickardJE A subtly powerful image
If I had nailed an image like that, I'd retire the very next day.
#GoodJob
